import React from "react";
import { BrowserRouter, Switch, Route, Link } from "react-router-dom";
import ItemListContainer from "../views/ItemListContainer/ItemListContainer";

export const Router = () => {
  return (
    <BrowserRouter>
      <Switch>
        <Route exact path="/">
          <h2>Inicio</h2>
          <ItemListContainer />
        </Route>
        <Route exact path="/list">
          <ItemListContainer />
        </Route>
        <Default />
      </Switch>
    </BrowserRouter>
  );
};

export default Router;
